//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.9;

import './IbcReceiver.sol';

enum IbcOrder {
    UNORDERED,
    ORDERED
}

struct Proof {
    bytes keyPath;  // packet key path
    bytes value;  // packet commitment
    bytes proof;
}

interface IbcDispatcher {
    function sendIbcPacket(
        bytes32 channelId,
        bytes calldata payload,
        uint64 timeoutBlockTimestamp
    ) external;

    function onRecvPacket(
        IbcReceiver receiver,
        IbcPacket calldata packet,
        Proof calldata proof
    ) external;

    function openIbcChannel(
        string calldata connectionId,
        string calldata counterPartyConnectionId,
        string calldata counterPartyPort,
        IbcOrder order,
        string calldata version
    ) external;

    function onOpenIbcChannel(
        IbcReceiver receiver,
        string calldata channelId,
        string calldata version,
        Proof calldata proof,
        string calldata error
    ) external;

    function connectIbcChannel(
        string calldata channelId,
        string calldata counterPartyChannelId,
        string calldata counterPartyPort,
        string calldata counterpartyVersion
    ) external;

    function onConnectIbcChannel(
        IbcReceiver receiver,
        string calldata channelId,
        Proof calldata proof,
        string calldata error
    ) external;

    function closeIbcChannel(
        string calldata channelId
    ) external;

    function onCloseIbcChannel(
        IbcReceiver receiver,
        string calldata channelId,
        Proof calldata proof,
        string calldata error
    ) external;

    function onAcknowledgementPacket(
        IbcReceiver receiver,
        IbcPacket calldata packet,
        bytes calldata acknowledgement,
        Proof calldata proof
    ) external;

    function onTimeoutPacket(
        IbcReceiver receiver,
        IbcPacket calldata packet,
        Proof calldata proof
    ) external;
}

contracts/IbcReceiver.sol.content:
//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.9;

struct IbcEndpoint {
    string portId;
    bytes32 channelId;
}

/// In IBC each package must set at least one type of timeout:
/// the timestamp or the block height.
struct IbcTimeout {
    uint64 block;
    uint64 timestamp;
}

struct IbcPacket {
    /// identifies the channel and port on the sending chain.
    IbcEndpoint src;
    /// identifies the channel and port on the receiving chain.
    IbcEndpoint dest;
    /// The sequence number of the packet on the given channel
    uint64 sequence;
    bytes data;
    /// when packet times out, measured on remote chain
    IbcTimeout timeout;
}

interface IbcReceiver {
    function onRecvPacket(IbcPacket calldata packet) external;

    function onAcknowledgementPacket(IbcPacket calldata packet) external;

    function onTimeoutPacket(IbcPacket calldata packet) external;

    function onOpenIbcChannel(string calldata channelId, string calldata version, string calldata error) external;

    function onConnectIbcChannel(string calldata channelId, string calldata error) external;

    function onCloseIbcChannel(string calldata channelId, string calldata error) external;
}

